'use strict';
let MessageType = require('./MessageType.js');
let InstrumentsList = require('./InstrumentsList.js');
class GetInstrumentsMessage {
    instrumentsList;
    requestId;
    constructor() {
        this.instrumentsList = new InstrumentsList();
        this.requestId = "";
    }
    getInstruments() {
        return this.instrumentsList.toArray();
    }
    getType() {
        return MessageType.GetInstruments;
    }
    getRequestId() {
        return this.requestId;
    }
}
module.exports = GetInstrumentsMessage
